import { FETCH_PRODUCTS } from "./types";
import { getProduct } from "../api/user";

export const fetchProducts = () => async (
  dispatch
) => {
  const res = await getProduct(
  );
  if (res)
      dispatch({
          type: FETCH_PRODUCTS,
          payload: res.data,
      })
}
